import * as _ from 'lodash';
import React, { Component } from 'react';
import { Radar, RadarChart, PolarGrid, Legend, Tooltip,
  PolarAngleAxis, PolarRadiusAxis, ResponsiveContainer,
  LabelList } from 'recharts';

// const data = [
//   { subject: 'Math', A: 120, B: 110, C: [80, 120] },
//   { subject: 'Chinese', A: 98, B: 130, C: [90, 113] },
//   { subject: 'English', A: 86, B: 130, C: [70, 134] },
//   { subject: 'Geography', A: null, B: 100, C: [88, 130] },
//   { subject: 'Physics', A: 85, B: 90, C: [55, 110] },
//   { subject: 'History', A: 65, B: 85, C: [60, 120] },
// ];

function RadarStats(data) {
  console.log(data)
    return (
        <div>
            <RadarChart outerRadius={90} width={730} height={250} data={data}>
            <PolarGrid />
            <PolarAngleAxis dataKey="subject" />
            <PolarRadiusAxis angle={30} domain={[0, 30]} />
            <Radar name="Mike" dataKey="2020-21" stroke="#8884d8" fill="#8884d8" fillOpacity={0.6} />
            <Radar name="Lily" dataKey="2019-20" stroke="#82ca9d" fill="#82ca9d" fillOpacity={0.6} />
            <Legend />
            </RadarChart>
        </div>
    )
}

export default RadarStats
